import styled from 'styled-components'

export const Menu = styled.button`
height: 40px;
background-color: white;
border: white;
`
export const ImgMenu = styled.img`
height: 30px;
`
export const ImgLogo = styled.img`
height: 50px;
align-items: bottom;
`

export const ImgSino = styled.img`
height: 25px;
margin-top: 5px;
`
export const ImgBusca = styled.img`
height: 20px;
`

export const Input = styled.input`
height: 30px;
width: 300px;
`
export const ContainerHeader = styled.div`
display: flex;
justify-content: space-between;
height: 50px;
`
export const Parte1 = styled.div`
display: flex;
`
export const Parte2 = styled.div`
display: flex;
margin-top: 5px;
`
export const Parte3 = styled.div`
display: flex;
`
export const BotaoBusca = styled.button`
height: 35px;
margin-right: 35px;
`
export const Hr = styled.hr`
width: 95%
`
